    const { removeTask, findItem } = useContext(TaskListContext)

    return (
        <div>
            <h5>{name}</h5>
            <h5>{price}</h5>
            <FaRegTrashAlt onClick={() => removeTask(task.id)}/>
            
            
        </div>
    );
}

